? n?rrebro bryghus , brewpub, ryesgade 3, the 2nd and most recent brewpub in copenhagen; they often offer many good beers (5 or 6) and a little choice but very nice food;
? den tatoverede enke (the tattooed widow), pub, in baron bolten's g?rd (gothersgade, just before kongens nytorv, very well hidden secret); they almost 15 belgian beers on draught and over 50 on bottle; they have all the trappistes including westvleteren and achel; they usually present a couple of beers on tap from the local and exceptional microbrewery br?ckhouse;
? apollo bryggeri , brewpub, vesterbrogade 3, close to the tivoli main entrance; till 2003 it used to be the only brewpub in the copenhagen; 2 beers, one beautiful, aromatic pilsner and a second monthly beer; recently they are less interesting than in the recent past;
? ?lbarens, pub, elmegade 2, close to n?rrebro bryghus, nice selection of bottles and keg beers;
? gammel strands ?l & vinlager, beershop, between gammel strand and nabol?s; they have a very nice selection of good danish beers, an interesting selection of belgian, german and world beers, mj?d and other spirits; they also have a few good swedish beers (nils oscar imperial stout and barley wine.
